package song.api.user.model;import org.springframework.format.annotation.DateTimeFormat;import song.common.toolkit.base.BaseModel;import java.util.Date;/** * description: * author:          song * createDate:      2018/4/13 */public class User extends BaseModel {    private String userId;    private String userCode;    private String organizationId;    private String userName;    private String realName;    private byte sex;    private String idcard;    private String mobile;    private String email;    private Date birthday;    private String address;    private byte status;    private String comment;    @DateTimeFormat(pattern = "yyyy-MM-dd HH:mm:ss")    private Date createTime;    public String getUserId() {        return userId;    }    public void setUserId(String userId) {        this.userId = userId;    }    public String getUserCode() {        return userCode;    }    public void setUserCode(String userCode) {        this.userCode = userCode;    }    public String getOrganizationId() {        return organizationId;    }    public void setOrganizationId(String organizationId) {        this.organizationId = organizationId;    }    public String getUserName() {        return userName;    }    public void setUserName(String userName) {        this.userName = userName;    }    public String getRealName() {        return realName;    }    public void setRealName(String realName) {        this.realName = realName;    }    public byte getSex() {        return sex;    }    public void setSex(byte sex) {        this.sex = sex;    }    public String getIdcard() {        return idcard;    }    public void setIdcard(String idcard) {        this.idcard = idcard;    }    public String getMobile() {        return mobile;    }    public void setMobile(String mobile) {        this.mobile = mobile;    }    public String getEmail() {        return email;    }    public void setEmail(String email) {        this.email = email;    }    public Date getBirthday() {        return birthday;    }    public void setBirthday(Date birthday) {        this.birthday = birthday;    }    public String getAddress() {        return address;    }    public void setAddress(String address) {        this.address = address;    }    public byte getStatus() {        return status;    }    public void setStatus(byte status) {        this.status = status;    }    public String getComment() {        return comment;    }    public void setComment(String comment) {        this.comment = comment;    }    public Date getCreateTime() {        return createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }}